var neural;

function def(){

	var train = [];

	for(var i = 0; i < dates.length; i++){
	//	for(var j = 0; j < dates[i].length*3/4; j++){
		for(var j = 0; j < 400; j++){
			train.push( [
				dates[i][j][0],
				dates[i][j][1],
				i
			] ) 
		}
	}
	console.log(train)

	create()

	for(var k = 0; k < 1000; k++){

		train.sort(compareRandom);

		for(var j = 0; j < train.length; j++){
			
			study(
				train[j][0],
				train[j][1],
				[train[j][2]/10]
			);
		}
	}


	for(var i = 0; i < dates.length; i++){
		for(var l = 400; l < 410; l++){
	
			work(
				dates[i][l][0],
				dates[i][l][1]
			);
	
			var Ok = neural.layers[layers].neuron[0].v;
		
			console.log(
				Math.round(Ok*10),
				Ok,
				dates[0][l]
			);
		}
		console.log('next');
	}
}


function compareRandom() {
	return Math.random() - 0.5;
}

function study( x, y, To){
	neural.layers[0].neuron[0].v = x
	neural.layers[0].neuron[1].v = y

	for(var i = 1; i < neural.layers.length; i++){


		var prNeu = neural.layers[i - 1].neuron;
		var crNeu = neural.layers[i].neuron;

		for(var j = 0; j < crNeu.length; j++){
			
			crNeu[j].v = 0;

			for(var k = 0; k < prNeu.length; k++){
				crNeu[j].v += prNeu[k].v * crNeu[j].w[k];
			}
			crNeu[j].v = 1 / ( 1 + Math.exp(-crNeu[j].v) );

		}
	}

	for(var i = 0; i < output; i++){
		var Ok = neural.layers[layers].neuron[i].v;
		neural.layers[layers].neuron[i].b = Ok*(1 - Ok)*(To[i] -  Ok);
	}

	for(var i = layers - 1; i > 0; i--){

		var crNeu = neural.layers[i].neuron;
		var nxNeu = neural.layers[i + 1].neuron;
	
		for(var j = 0; j < crNeu.length; j++){
			crNeu[j].b = 0;
			for(var k = 0; k < nxNeu.length; k++){
				crNeu[j].b += nxNeu[k].w[j]*nxNeu[k].b;
			}
			crNeu[j].b = crNeu[j].v * (1 - crNeu[j].v) * crNeu[j].b;
		}
	}


	for(var i = 1; i < neural.layers.length; i++){
		for(var j = 0; j < neural.layers[i].neuron.length; j++){

			var crNeu = neural.layers[i].neuron[j];

			for(var k = 0; k < crNeu.w.length; k++){
				crNeu.w[k] = crNeu.w[k] + n	* crNeu.b * neural.layers[i - 1].neuron[k].v;			
			}
		}
	}
}

function work(x, y){
	neural.layers[0].neuron[0].v = x
	neural.layers[0].neuron[1].v = y

	for(var i = 1; i < neural.layers.length; i++){

		var prNeu = neural.layers[i - 1].neuron;
		var crNeu = neural.layers[i].neuron;

		for(var j = 0; j < crNeu.length; j++){
			
			crNeu[j].v = 0;

			for(var k = 0; k < prNeu.length; k++){
				crNeu[j].v += prNeu[k].v * crNeu[j].w[k];
			}
			crNeu[j].v = 1 / ( 1 + Math.exp(-crNeu[j].v) );
		}
	}
}

function create(){	
	neural = {
		layers : []
	}

	neural.layers.push({
		neuron: []
	})

	for(var j = 0; j < dimension; j++){
		neural.layers[0].neuron.push({
			v: 0
		})
	}


	for(var i = 1; i < layers; i++){

		neural.layers.push({
			neuron: []
		})

		for(var j = 0; j < neuron; j++){
			neural.layers[i].neuron.push({
				w: [],
				v: 0,
				e: 0
			});

			for(var k = 0; k < neural.layers[i - 1].neuron.length; k++ ){
				neural.layers[i].neuron[j].w.push(Math.random());
			}
		}
	}

	neural.layers.push({
		neuron: []
	})

	for(var j = 0; j < output; j++){
		neural.layers[layers].neuron.push({
			v: 0,
			w: []
		})

		for(var k = 0; k < neuron; k++ ){
			neural.layers[layers].neuron[j].w.push(Math.random());
		}
	}
}